“Comuni d’Italia” è l’applicazione che ti permette di avere l’Italia in tasca.
In pochi secondi puoi trovare CAP, prefissi, codici catastali, feste patronali, i luoghi della cultura, recapiti e un'infinità di altri dati relativi agli attuali 7904 Comuni italiani.

Per ogni Comune potrai consultare informazioni aggiornate su:

- CAP, prefisso, codice catasto, codice ISTAT;
- dati geografici, demografici e riferimenti vari (recapiti del comune, festa patronale, sito web ufficiale, ecc);
- mappa geografica con indicazione dei confini del comune
- composizione del governo comunale (giunta e consiglio)
- elenco degli enti della pubblica amministrazione nel comune 
- integrazione con il localizzatore GPS, se disponibile (non su iPod);
- gli eventi culturali e le feste patronali in corso alla data attuale e nei giorni successivi;
- i Luoghi della cultura che si trovano sul territorio comunale
- possibilità di aggiungere delle note al Comune e di salvarlo nei Preferiti.


Per qualsiasi domanda o richiesta di supporto, puoi contattarci all'indirizzo e-mail helpdesk@logicainformatica.it.

